from api.category_api import CategoryViewSetfrom api.location_api import LocationViewSetfrom api.service_api import ServiceViewSetfrom api.order_api import OrderViewSetfrom api.schedule_api import ScheduleViewSetfrom api.review_api import ReviewViewSetfrom api.payment_api import PaymentViewSetfrom api.settings import ApplicationSettingViewSetfrom rest_framework.routers import DefaultRouterrouter = DefaultRouter()router.register('category', CategoryViewSet)router.register('location', LocationViewSet)router.register('service', ServiceViewSet)router.register('order', OrderViewSet)router.register('schedule', ScheduleViewSet)router.register('review', ReviewViewSet)router.register('payment', PaymentViewSet)router.register('application/setting', ApplicationSettingViewSet)urlpatterns = router.urls